import React, { useEffect, useState } from "react";

// ascii (String.prototype.charCodeAt) codes for uppercase letters start at 65
const ASCI_UPPER_CASE_OFFSET = 65;
const ALPHABET_SIZE = 26;

// strip all non alphabetic characters and convert lowercase to uppercase
// returns only capital ascii letters
const sanitizeInput = (input) => input.replace(/[^a-zA-Z]/g, "").toUpperCase();

function encrypt(message, keyword) {
  message = sanitizeInput(message);
  keyword = sanitizeInput(keyword);

  const encryptedMessage = message
    .split("")
    .map((_char, i) => {
      const msgCharOffset = message.charCodeAt(i) - ASCI_UPPER_CASE_OFFSET;
      const keywordCharOffset =
        keyword.charCodeAt(i % keyword.length) - ASCI_UPPER_CASE_OFFSET;

      return String.fromCharCode(
        ((25 - msgCharOffset - keywordCharOffset) % ALPHABET_SIZE) + ASCI_UPPER_CASE_OFFSET
      );
    })
    .join("");

  return encryptedMessage;
}

function decrypt(encryptedMessage, keyword) {
  
  encryptedMessage = sanitizeInput(encryptedMessage);
  keyword = sanitizeInput(keyword);

  const decryptedMessage = encryptedMessage
    .split("")
    .map((_char, i) => {
      const encryptedCharOffset = encryptedMessage.charCodeAt(i) - ASCI_UPPER_CASE_OFFSET;
      const keywordCharOffset =
        keyword.charCodeAt(i % keyword.length) - ASCI_UPPER_CASE_OFFSET;

      return String.fromCharCode(
        (25 - msgCharOffset - keywordCharOffset) % ALPHABET_SIZE) + ASCI_UPPER_CASE_OFFSET
    })
    .join("");

  return decryptedMessage;
}

const Home = () => {
  useEffect(() => {});

  const [message, setMessage] = useState("");
  const [key, setKey] = useState("");
  const [encryptedMessageOutput, setEncryptedMessageOutput] = useState("");
  const [encryptedMessage, setEncryptedMessage] = useState("");
  const [decryptedMessageOutput, setdecryptedMessageOutput] = useState("");

  const handleMessageChange = (e) => {
    setMessage(e.target.value);
  };

  const handleKeyChange = (e) => {
    setKey(e.target.value);
  };

  const handleFormEncryptSubmit = (e) => {
    e.preventDefault();

    setEncryptedMessageOutput(`Encrypted Message: ${encrypt(message, key)}`);
  };

  const handleEncryptedMessageChange = (e) => {
    setEncryptedMessage(e.target.value);
  };

  const handleFormDecryptSubmit = (e) => {
    e.preventDefault();

    setdecryptedMessageOutput(
      `Decrypted Message: ${decrypt(encryptedMessage, key)}`
    );
  };

  return (
    <div className="home">
      <div className="split left">
        <form onSubmit={handleFormEncryptSubmit}>
          <div>
            <label htmlFor="message">Message:</label>
            <input
              type="text"
              id="message"
              value={message}
              onChange={handleMessageChange}
            />
          </div>
          <div>
            <label htmlFor="key">Key:</label>
            <input
              type="text"
              id="key"
              value={key}
              onChange={handleKeyChange}
            />
          </div>
          <button type="submit">Submit</button>
        </form>
        <section className="output">
          <h3>{encryptedMessageOutput}</h3>
        </section>
      </div>
      <div className="split right">
        <form onSubmit={handleFormDecryptSubmit}>
          <div>
            <label htmlFor="encryptedMessage">Encrypted Message:</label>
            <input
              type="text"
              id="encryptedMessage"
              value={encryptedMessage}
              onChange={handleEncryptedMessageChange}
            />
          </div>
          <div>
            <label htmlFor="key">Key:</label>
            <input
              type="text"
              id="key"
              value={key}
              onChange={handleKeyChange}
            />
          </div>
          <button type="submit">Submit</button>
        </form>
        <section className="output">
          <h3>{decryptedMessageOutput}</h3>
        </section>
      </div>
    </div>
  );
};

export default Home;
